import React from "react";
import "./form.css";

const FormSection = () => {
  return (
    <>
      <div className="form-container">
        <div className="faq">
          <div className="box">
            <div className="bar-red"></div>
            <span>FAQ</span>
          </div>
          <div className="btn-container">
            <button className="para-expand"></button>
          </div>
        </div>
        <div className="form"></div>
      </div>
    </>
  );
};
export default FormSection;
